import React from "react";
import "./Testimonials.css";
import Image1 from "../../assests/avatar-1.svg";
import Image3 from "../../assests/avatar-3.svg";

const data = [
  {
    id: 1,
    image: Image1,
    title: "John Doe",
    subtitle: "Product designer at Dribble",
    comment:
      "I enjoy working with the theme and learn so much. You       guys make the process fun and interesting. Good luck! ðŸ‘",
  },
  {
    id: 2,
    image: Image3,
    title: "John Doe",
    subtitle: "Product designer at Dribble",
    comment:
      "I enjoy working with the theme and learn so much. You       guys make the process fun and interesting. Good luck! ðŸ‘",
  },
];

const Testimonials = () => {
  return (
    <section className="testimonials container section">
      <h2 className="section__title">Clients & Reviews</h2>
      <div className="testimonials__container grid">
        {data.map(({ id, image, title, subtitle, comment }) => {
          return (
            <div className="testimonials__items" key={id}>
              <div className="thumb">
                <img src={image} alt="" />
              </div>
              <h3 className="testimonials__title"></h3>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Testimonials;
